import React from 'react'
import Dropdown from "react-bootstrap/Dropdown";
import DropdownButton from "react-bootstrap/DropdownButton";
import Form from "react-bootstrap/Form";
import InputGroup from "react-bootstrap/InputGroup";
import { Link } from "react-router-dom";
import { useState , useEffect } from "react";
import UserBookings from '../pages/user/UserBookings';
import BookingCard from './cards/users/BookingCard';



var data = [{}];
data = JSON.parse(localStorage.getItem("user"));
const id = data._id;
function Search() {

    useEffect (() => {
        const fetchBookings = async () => {
            const response = await fetch('http:localhost:4000/api/bookings')
        }
        fetchBookings()
    }, [])

    const [searchTerm,setsearchTerm] = useState('');
    const [value,setValue]=useState(''); // selected value in filter

    const handleSelect=(e)=>{
    console.log(e);
    setValue(e)
                            }
  
  console.log(id)
  
  return (
    <div>
      
      <InputGroup className="mb-3">
        <form >
          <input
            aria-label="Text input with dropdown button"
            placeholder="Search"

            onChange={(event) => {setsearchTerm(event.target.value); console.log(searchTerm)}}
          />
         
          <DropdownButton
            variant="secondary"
            title="Filter by"
            id="input-group-dropdown-2"
            align="end"
            onSelect={handleSelect}
          >
            <Dropdown.Item eventKey="brand" >
              Brand
            </Dropdown.Item>
            <Dropdown.Divider />
            <Dropdown.Item eventKey="stats" >
              Status
            </Dropdown.Item>
          </DropdownButton>
          </form>
        </InputGroup>
        
                 
            


    </div>
  )
}

export default Search
